pragma solidity ^0.5.2;
import "./myOracle.sol";

contract Game {    
    string[] winners;   
    address oracle_address; 
    event Winner(address sender, string who);    
    function win(string memory winner) public {        
        winners.push(winner);        
        emit Winner(msg.sender, winner);    
    }

    function setOracle(address o) public{
        oracle_address = o;
    }

    function getOracle() public view returns (address oracle_addr){
        return oracle_address;
    }

    function oracleCallBack(string memory winner) public{
        emit Winner(address(this), winner);
    }

}
